import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext';
import DashboardLayout from './components/dashboard/layout/DashboardLayout';
import DashboardPage from './components/dashboard/DashboardPage';
import PaymentMethodsPage from './components/dashboard/pages/PaymentMethodsPage';
import IdentityManagementPage from './components/dashboard/pages/IdentityManagementPage';
import LoginPage from './components/auth/LoginPage';
import SignupPage from './components/auth/SignupPage';
import HomePage from './components/homepage/HomePage';
import './App.css';

// Protected route component
const ProtectedRoute = ({ children }) => {
  // In a real app, this would check for authentication
  const isAuthenticated = localStorage.getItem('sunnyAuthToken');

  if (!isAuthenticated) {
    return <Navigate to="/login" replace />;
  }

  return children;
};

function App() {
  return (
    <AuthProvider>
      <Router>
        <Routes>
          {/* Public routes */}
          <Route path="/" element={<HomePage />} />
          <Route path="/login" element={<LoginPage />} />
          <Route path="/signup" element={<SignupPage />} />

          {/* Dashboard routes */}
          <Route path="/dashboard" element={
            <ProtectedRoute>
              <DashboardLayout>
                <DashboardPage />
              </DashboardLayout>
            </ProtectedRoute>
          } />

          <Route path="/payment-methods" element={
            <ProtectedRoute>
              <DashboardLayout>
                <PaymentMethodsPage />
              </DashboardLayout>
            </ProtectedRoute>
          } />

          <Route path="/identity-management" element={
            <ProtectedRoute>
              <DashboardLayout>
                <IdentityManagementPage />
              </DashboardLayout>
            </ProtectedRoute>
          } />

          {/* Add more routes for other dashboard pages */}
          <Route path="/transactions" element={
            <ProtectedRoute>
              <DashboardLayout>
                <div>Transactions Page (Coming Soon)</div>
              </DashboardLayout>
            </ProtectedRoute>
          } />

          <Route path="/balances" element={
            <ProtectedRoute>
              <DashboardLayout>
                <div>Balances Page (Coming Soon)</div>
              </DashboardLayout>
            </ProtectedRoute>
          } />

          <Route path="/mobile-money" element={
            <ProtectedRoute>
              <DashboardLayout>
                <div>Mobile Money Page (Coming Soon)</div>
              </DashboardLayout>
            </ProtectedRoute>
          } />

          <Route path="/bank-transfers" element={
            <ProtectedRoute>
              <DashboardLayout>
                <div>Bank Transfers Page (Coming Soon)</div>
              </DashboardLayout>
            </ProtectedRoute>
          } />

          <Route path="/crypto" element={
            <ProtectedRoute>
              <DashboardLayout>
                <div>Crypto Page (Coming Soon)</div>
              </DashboardLayout>
            </ProtectedRoute>
          } />

          <Route path="/cards" element={
            <ProtectedRoute>
              <DashboardLayout>
                <div>Cards Page (Coming Soon)</div>
              </DashboardLayout>
            </ProtectedRoute>
          } />

          <Route path="/customers" element={
            <ProtectedRoute>
              <DashboardLayout>
                <div>Customers Page (Coming Soon)</div>
              </DashboardLayout>
            </ProtectedRoute>
          } />

          <Route path="/global-markets" element={
            <ProtectedRoute>
              <DashboardLayout>
                <div>Global Markets Page (Coming Soon)</div>
              </DashboardLayout>
